import React from "react";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  //---mobile stuff
  faSwift, //#ec3b2e

  //---web stuff
  faReact, //#62ceec
  faNodeJs, //#84b923
  faAws, //mention amplify, cognito, datastore, rds, //#212d3b
  faPhp, //#828cb5
  faJsSquare, //#e9d137
  faHtml5, //#e36132
  faCss3Alt, //#30a1d2

  //---game stuff
  faUnity, //black

  //---other stuff
  faPython, //black

  //---source control
  faGithub, //black
  faBitbucket, //#1454bc

  //---baby stuff
  faWix, //#efb372 or black
  faShopify, //#8bb04b
  faWordpressSimple, //#0e7090
} from "@fortawesome/free-brands-svg-icons";

//---mobile stuff
//missing dart ./graphics/tools/dart.png
//missing flutter ./graphics/tools/flutter.png
//missing firebase ./graphics/tools/firebase.png

//---web
//mention ruby on rails ./graphics/tools/rails.png
//mention .NET framework ./graphics/tools/dotNet.png

//---baby stuff
//missing webflow ./graphics/tools/webflow.png

//---game
//get C# ./graphics/tools/cSharp.png

//---IDEs
//VS Code ./graphics/tools/vsCode.png
//Visual Studios ./graphics/tools/visualStudios.png

//---graphics
//missing photoshop ./graphics/tools/photoshop.png
//missing premiere ./graphics/tools/premiere.png

//---other
//missing C ./graphics/tools/c.png
//missing C++ ./graphics/tools/cPlusPlus.png
//missing java ./graphics/tools/java.png

import IconTool from "./tools/logoTools";

export default function Tool(props) {
  switch (props.tool) {
    case "swift":
      return (
        <IconTool
          icon={faSwift}
          hoverColor="#ec3b2e"
          tip="Swift"
          src="https://developer.apple.com/swift/"
        />
      );
    case "react":
      return (
        <IconTool
          icon={faReact}
          hoverColor="#62ceec"
          tip="React JS"
          src="https://reactjs.org/"
        />
      );
    case "node":
      return (
        <IconTool
          icon={faNodeJs}
          hoverColor="#84b923"
          tip="Node JS"
          src="https://nodejs.org/"
        />
      );

    case "aws":
      return (
        <IconTool
          icon={faAws}
          hoverColor="#212d3b"
          tip="AWS Amplify, Cognito, Datastore, and more"
          src="https://aws.amazon.com/amplify/"
        />
      );
    case "php":
      return (
        <IconTool
          icon={faPhp}
          hoverColor="#828cb5"
          tip="Php"
          src="https://www.php.net/"
        />
      );
    case "js":
      return (
        <IconTool
          icon={faJsSquare}
          hoverColor="#e9d137"
          tip="Javascript"
          src="https://www.javascript.com/"
        />
      );

    case "html":
      return (
        <IconTool
          icon={faHtml5}
          hoverColor="#e36132"
          tip="HTML 5"
          src="https://en.wikipedia.org/wiki/HTML5"
        />
      );
    case "css":
      return (
        <IconTool
          icon={faCss3Alt}
          hoverColor="#30a1d2"
          tip="CSS 3"
          src="https://en.wikipedia.org/wiki/CSS"
        />
      );
    case "unity":
      return (
        <IconTool
          icon={faUnity}
          hoverColor="#202020"
          tip="Unity 3D"
          src="https://unity.com/"
        />
      );
    case "python":
      return (
        <IconTool
          icon={faPython}
          hoverColor="#202020"
          tip="Python"
          src="https://www.python.org/"
        />
      );
    case "github":
      return (
        <IconTool
          icon={faGithub}
          hoverColor="#202020"
          tip="Github"
          src="https://github.com/"
        />
      );
    case "bitbucket":
      return (
        <IconTool
          icon={faBitbucket}
          hoverColor="#1454bc"
          tip="Bit Bucket"
          src="https://bitbucket.org/"
        />
      );
    case "wix":
      return (
        <IconTool
          icon={faWix}
          hoverColor="#efb372"
          tip="Wix"
          src="https://www.wix.com"
        />
      );
    case "shopify":
      return (
        <IconTool
          icon={faShopify}
          hoverColor="#8bb04b"
          tip="Shopify"
          src="https://www.shopify.com"
        />
      );
    case "wordpress":
      return (
        <IconTool
          icon={faWordpressSimple}
          hoverColor="#0e7090"
          tip="Wordpress .COM and .ORG"
          src="https://wordpress.com/"
        />
      );
    default:
      return (
        <IconTool
          icon={faSwift}
          hoverColor="#ec3b2e"
          tip="Swift"
          src="https://developer.apple.com/swift/"
        />
      );
  }
}
